public Set<Path> listTombstones() {
  Set<Path> tombstones = new HashSet<>();
  for (PathMetadata meta : listMap.values()) {
    if (meta.isDeleted()) {
      tombstones.add(meta.getFileStatus().getPath());
    }
  }
  return tombstones;
}
